function parse_gps( input ) {

    if( input.indexOf( 'N' ) == -1 && input.indexOf( 'S' ) == -1 &&
        input.indexOf( 'W' ) == -1 && input.indexOf( 'E' ) == -1 ) {
        return input.split(',');
    }
    
    let parts = input.split(/[Â°'"]+/).join(' ').split(/[^\w\S]+/);
    let directions = [], coords = [], dd = 0, pow = 0;
    
    for( i in parts ) {
        // we end on a direction
        if( isNaN( parts[i] ) ) {
    
            let _float = parseFloat( parts[i] );
    
            let direction = parts[i];
    
            if( !isNaN(_float ) ) {
                dd += ( _float / Math.pow( 60, pow++ ) );
                direction = parts[i].replace( _float, '' );
            }
    
            direction = direction[0];
    
            if( direction == 'S' || direction == 'W' )
                dd *= -1;
    
            directions[ directions.length ] = direction;
    
            coords[ coords.length ] = dd;
            dd = pow = 0;
    
        } else {
    
            dd += ( parseFloat(parts[i]) / Math.pow( 60, pow++ ) );
        }
    }
    
    if( directions[0] == 'W' || directions[0] == 'E' ) {
        var tmp = coords[0];
        coords[0] = coords[1];
        coords[1] = tmp;
    }
    
    return coords;
    }


GeoPoint = function(lon, lat) {


    switch (typeof(lon)) {

        case 'number':

            this.lonDeg = this.dec2deg(lon, this.MAX_LON);
            this.lonDec = lon;

            break;

        case 'string':

            if (this.decode(lon)) {
                this.lonDeg = lon;
            }

            this.lonDec = this.deg2dec(lon, this.MAX_LON);

            break;
    }

    switch (typeof(lat)) {

        case 'number':

            this.latDeg = this.dec2deg(lat, this.MAX_LAT);
            this.latDec = lat;

            break;

        case 'string':

            if (this.decode(lat)) {
                this.latDeg = lat;
            }

            this.latDec = this.deg2dec(lat, this.MAX_LAT);

            break;

    }
};

GeoPoint.prototype = {

    CHAR_DEG : "\u00B0",
    CHAR_MIN : "\u0027",
    CHAR_SEC : "\u0022",
    CHAR_SEP : "\u0020",

    MAX_LON: 180,
    MAX_LAT: 90,

    // decimal
    lonDec: NaN,
    latDec: NaN,

    // degrees
    lonDeg: NaN,
    latDeg: NaN,

    dec2deg: function(value, max) {

        var sign = value < 0 ? -1 : 1;

        var abs = Math.abs(Math.round(value * 1000000));

        if (abs > (max * 1000000)) {
            return NaN;
        }

        var dec = abs % 1000000 / 1000000;
        var deg = Math.floor(abs / 1000000) * sign;
        var min = Math.floor(dec * 60);
        var sec = (dec - min / 60) * 3600;

        var result = "";

        result += deg;
        result += this.CHAR_DEG;
        result += this.CHAR_SEP;
        result += min;
        result += this.CHAR_MIN;
        result += this.CHAR_SEP;
        result += sec.toFixed(2);
        result += this.CHAR_SEC;

        return result;

    },

    deg2dec: function(value) {

        var matches = this.decode(value);

        if (!matches) {
            return NaN;
        }

        var deg = parseFloat(matches[1]);
        var min = parseFloat(matches[2]);
        var sec = parseFloat(matches[3]);

        if (isNaN(deg) || isNaN(min) || isNaN(sec)) {
            return NaN;
        }

        return deg + (min / 60.0) + (sec / 3600);
    },

    decode: function(value) {
        var pattern = "";

        // deg
        pattern += "(-?\\d+)";
        pattern += this.CHAR_DEG;
        pattern += "\\s*";

        // min
        pattern += "(\\d+)";
        pattern += this.CHAR_MIN;
        pattern += "\\s*";

        // sec
        pattern += "(\\d+(?:\\.\\d+)?)";
        pattern += this.CHAR_SEC;

        return value.match(new RegExp(pattern));
    },

    getLonDec: function() {
        return this.lonDec;
    },

    getLatDec: function() {
        return this.latDec;
    },

    getLonDeg: function() {
        return this.lonDeg;
    },

    getLatDeg: function() {
        return this.latDeg;
    }

};

